import React, {useState,useEffect} from 'react';
import Problem from '../../components/Problem/Problem';
import './Problems.css';

function sortTableByQuestionCount() {
    let table = document.getElementById("problemsTable");
    let rows = Array.from(table.rows).slice(1); 

    rows.sort((a, b) => {
        let questiosA = parseInt(a.cells[3].innerText);
        let questionsB = parseInt(b.cells[3].innerText);
        return questionsB - questiosA; 
    });

    let tbody = table.tBodies[0];
    tbody.append(...rows);
}

const Problems = () => {
    const [problems, setProblems] = useState([]);

    useEffect(()=>{
        console.log("Loading Data ...")
        sortTableByQuestionCount();
        fetch("https://jsonplaceholder.typicode.com/posts")
                .then(response=>response.json())
                .then(data=>setProblems(data))
    },[])

    return (
        <div>
            {/* <h1>Problems Table</h1> */}
            {/* <main>
                {
                    problems.map((problem)=>{
                        return <Problem key={problem.id} title={problem.title} content={problem.body}/>
                    })
                }
            </main> */}
            <main>
                <h1>All Problems</h1>
                <table id="problemsTable">
                    <thead>
                        <tr>
                            <th>Problem</th>
                            <th>Hardness</th>
                            <th>Solved</th>
                            <th>Label</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td><a href="problemprofile.html">N-Queen</a></td>
                            <td>Hard</td>
                            <td><a href="#">20</a></td>
                            <td><a href="#">CS</a></td>
                        </tr>
                        <tr>
                            <td><a href="problemprofile.html">Sub</a></td>
                            <td>Easy</td>
                            <td><a href="#">245</a></td>
                            <td><a href="#">Math</a></td>
                        </tr>
                        <tr>
                            <td><a href="problemprofile.html">Iran</a></td>
                            <td>Hard</td>
                            <td><a href="#">80</a></td>
                            <td><a href="#">History</a></td>
                        </tr>
                    </tbody>
                </table>
            </main>
        </div>

    );
}

export default Problems;

